import React from 'react';
import './App.css';
import RoomCollectionCard, { ICardProps } from './components/organisms/RoomCollectionCard';
import { Grid } from '@material-ui/core';

export const list:ICardProps[] = [
  {cardName: 'Kitchen', maxWidth: 330,aboutCard: 'Elegant, refined and graceful.  Clasico lacks garnish or overstated design elements that shout for attention. It is permanently current.'},
  {cardName: 'BathRoom', maxWidth: 330, cardImage: 'https://static.onecms.io/wp-content/uploads/sites/23/2019/01/25/bathroom-design-ideas-cleaner-bathroom-marble-tile.jpg', aboutCard: 'Elegant, refined and graceful.  Clasico lacks garnish or overstated design elements that shout for attention. It is permanently current.'},
  {cardName: 'Kitchen', cardImage: 'https://hips.hearstapps.com/hmg-prod.s3.amazonaws.com/images/kitchen-ideas-hbx110119wholehome-015-1572549271.jpg', maxWidth: 330,aboutCard: 'Elegant, refined and graceful.  Clasico lacks garnish or overstated design elements that shout for attention. It is permanently current.'},
  {cardName: 'BathRoom', maxWidth: 330, cardImage: 'https://static.onecms.io/wp-content/uploads/sites/23/2019/01/25/bathroom-design-ideas-cleaner-bathroom-marble-tile.jpg', aboutCard: 'Elegant, refined and graceful.  Clasico lacks garnish or overstated design elements that shout for attention. It is permanently current.'},
  {cardName: 'Kitchen', cardImage: 'https://hips.hearstapps.com/hmg-prod.s3.amazonaws.com/images/kitchen-ideas-hbx110119wholehome-015-1572549271.jpg', maxWidth: 330,aboutCard: 'Elegant, refined and graceful.  Clasico lacks garnish or overstated design elements that shout for attention. It is permanently current.'},
  {cardName: 'BathRoom', maxWidth: 330, cardImage: 'https://static.onecms.io/wp-content/uploads/sites/23/2019/01/25/bathroom-design-ideas-cleaner-bathroom-marble-tile.jpg', aboutCard: 'Elegant, refined and graceful.  Clasico lacks garnish or overstated design elements that shout for attention. It is permanently current.'},
]

function App() {
  return (
    <Grid container direction="row" spacing={1}>
        {list.map((each: ICardProps, index: number) => (

            <RoomCollectionCard 
                cardName={list[index].cardName}
                cardImage={list[index].cardImage}
                maxWidth={list[index].maxWidth} 
                aboutCard={list[index].aboutCard}
            />
        ))}
    </Grid>
  );
}

export default App;
